    <script>
        function updateColormapTitle(layerName) {
            var title = "Concentração (µg/m³)";
            if (layerName.includes("SO2")) title = "Concentração de SO2 (µg/m³)";
            else if (layerName.includes("NO2")) title = "Concentração de NO2 (µg/m³)";
            else if (layerName.includes("CO")) title = "Concentração de CO (µg/m³)";
            else if (layerName.includes("PTS")) title = "Concentração de PTS (µg/m³)";
            document.querySelector(".legend b").innerText = title;
        }

        map.on('overlayadd', function(event) {
            updateColormapTitle(event.name);
        });
    </script>
